import React, {useCallback, useEffect, useState} from 'react';

const SuperHeaderTag = React.memo(function({key, className, onClickFunc, label}){

    const onClickNew = onClickFunc.bind(undefined, label);

    return <th key={key} className={className} onClick={onClickNew}>{label}</th>
});

export default SuperHeaderTag;
